import React from 'react'
import { FaClinicMedical } from "react-icons/fa";

import { CategoryStyle } from './CategoryStyle'
import './category.css'

function Categories() {
  return (
    <div className='categories'>
        <CategoryStyle>
        < FaClinicMedical />
        <span className='categoryName'>  First Aid </span>
        </CategoryStyle>
    </div>
  )
}

export default Categories
